import React, { useState, useCallback } from 'react';
import { GoogleMap, LoadScript, Marker, DirectionsService, DirectionsRenderer } from '@react-google-maps/api';
import './styles/MapContainer.css';

// Map configuration
const containerStyle = {
  width: '100%',
  height: '500px',
};

const center = {
  lat: -1.286389,
  lng: 36.817223,
};

const MapContainer = () => {
  const [directionsResponse, setDirectionsResponse] = useState(null);
  const [pickupLocation, setPickupLocation] = useState('');
  const [deliveryLocation, setDeliveryLocation] = useState('');
  const [carDetails, setCarDetails] = useState({
    registration: '',
    type: '',
    weight: '',
  });
  const [isSubmitting, setIsSubmitting] = useState(false);

  // For learning purposes ONLY - replace with your actual key in production
  const googleMapsApiKey = "AIzaSyBoyZ1H81_TBDC_m0I8gyGykfLfRN5IdFY";

  const handleDirectionsResponse = useCallback((response) => {
    if (response !== null && response.status === 'OK') {
      setDirectionsResponse(response);
    }
  }, []);

  const handleSubmit = (e) => {
    e.preventDefault();
    setIsSubmitting(true);
    
    // Simulate API call
    setTimeout(() => {
      alert(`Booking submitted!\nCar: ${carDetails.registration}\nFrom: ${pickupLocation}\nTo: ${deliveryLocation}`);
      setIsSubmitting(false);
    }, 1000);
  };

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setCarDetails(prev => ({ ...prev, [name]: value }));
  };

  return (
    <div className="directions-container">
      <h2>Car Rescue Booking</h2>

      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label>Car Registration</label>
          <input
            type="text"
            name="registration"
            value={carDetails.registration}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Car Type</label>
          <input
            type="text"
            name="type"
            value={carDetails.type}
            onChange={handleInputChange}
            required
          />
        </div>

        <div className="form-group">
          <label>Car Weight (kg)</label>
          <input
            type="number"
            name="weight"
            value={carDetails.weight}
            onChange={handleInputChange}
            required
            min="500"
          />
        </div>

        <div className="form-group">
          <label>Pickup Location</label>
          <input
            type="text"
            value={pickupLocation}
            onChange={(e) => setPickupLocation(e.target.value)}
            required
            placeholder="Enter address"
          />
        </div>

        <div className="form-group">
          <label>Delivery Location</label>
          <input
            type="text"
            value={deliveryLocation}
            onChange={(e) => setDeliveryLocation(e.target.value)}
            required
            placeholder="Enter address"
          />
        </div>

        <button 
          type="submit" 
          disabled={isSubmitting}
          className="submit-btn"
        >
          {isSubmitting ? 'Processing...' : 'Complete Booking'}
        </button>
      </form>

      {/* 
        SECURITY WARNING: 
        This API key is for learning purposes only.
        For production, use environment variables and restrict the key.
        See: https://developers.google.com/maps/documentation/javascript/get-api-key
      */}
      <LoadScript googleMapsApiKey={googleMapsApiKey}>
        <GoogleMap
          mapContainerStyle={containerStyle}
          center={center}
          zoom={12}
        >
          {pickupLocation && deliveryLocation && (
            <DirectionsService
              options={{
                origin: pickupLocation,
                destination: deliveryLocation,
                travelMode: 'DRIVING',
              }}
              callback={handleDirectionsResponse}
            />
          )}

          {directionsResponse && (
            <DirectionsRenderer
              options={{
                directions: directionsResponse,
                suppressMarkers: false,
              }}
            />
          )}

          {!directionsResponse && <Marker position={center} />}
        </GoogleMap>
      </LoadScript>
    </div>
  );
};

export default MapContainer;
